  return (
    <div className="service-card" style={{ "--accent": color }}>
      
      <div className="service-icon">
        {icon}
      </div>

      <h3>{title}</h3>
      <p>{desc}</p>

      <Link to={link} className="service-btn">
        Learn More â†’
      </Link>
    </div>
  );
};

export default ServiceCard;
